import PropTypes from 'prop-types';

TextInput.propTypes = {
    name: PropTypes.string.isRequired,//Nombre de la clase que va a tener el div
    label: PropTypes.string.isRequired//Mostrado en la label
}

export const TextInput = ({ name, label }) => {//Pedirá un dato con un input tipo text
    return (
        <div className={'div' + name}>
            <label>{label + ':  '}</label>
            <input type="text" name="name" autoComplete="off" />
        </div>
    );
}
